namespace app\admin\model;

use think\Model;

class GoldCardStatisticsModel extends Model
{
    /**
     * 模型名称
     * @var string
     */
    protected $name = 'gold_card_statistics';

    public function insert(array $data = [], bool $getLastInsID = false)
    {
        return parent::insert($data, $getLastInsID); // TODO: Change the autogenerated stub
    }

    public function get_timebydata($date) {
            return $this->where('dateTime',$date)->find();
    }
}
